import styled from 'styled-components'

interface Props {
    key: number,
    BoxContent: { 
        photo: string
    }
}



const GridBox: React.FC<Props> = ({BoxContent}) => {
        console.log(BoxContent.photo)
        const BoxContainer = styled.li<{emphasized: boolean}`
            width: 30%;
            height: 100px;
            background-image: ${BoxContent => BoxContent.photo};
        `

        return (
            <BoxContainer></BoxContainer>
        );


}




export default GridBox;
